import React from "react";
import {Pagination} from "@nextui-org/react";

export default function Paginations(value) {
    console.log(value, typeof(value));
  return (
    <>
      {value.map((size) => (
        <Pagination total={4} initialPage={1} size={25} />
      ))}
    </>
  );
}
